B.a8s=new A.m(B.a97,["Welcome","Connection timeout. Please check your internet connection.","Sending the request took too long. Check your internet connection.","The server took too long to respond. Try again later.","Error in server response. Try again later.","The request was canceled. Please try again.",u.s,"It seems you are not connected to the internet. Please check your connection.",u.s,"Bad request. Please check the inputs.","Unauthorized. Please check your login details.","Access denied.","Resource not found.","Server error. Please try again later.","Service unavailable. Please try again later.","Unexpected error. Please try again.","Please try again later or contact support","Retry","Wow Information Technology","Travel and Tourism Services","Wow Information Technology","All rights reserved. Copyright","Skip","Home","Next","Done","en","Our Products","Language","Our Services","Services","Airline and Hotel Booking System","Create an online system that provides options for booking flights, hotels, and resorts, along with direct access to flight and accommodation information.","XML / API Systems","Integrate your website with high-quality XML / API systems, connecting it directly to hotel and airline systems worldwide.","Website Development and Creation","Mobile Application Development","Offer travel services such as flight and hotel bookings through mobile devices for your customers and link them to your website.","Our Clients",B.Yk,"Travel solutions with us put you in the competition",B.a0H,"Our Partners","Contact Us","Email","sales@wowit.com","Phone",B.u3,"Our Services",B.SU,"Products",B.WC,"Welcome to Wow Information Technology","The best travel and tourism solutions in one place, helping you book flights and hotels easily and professionally.","Smart Fast Connection","Our system offers direct integration with XML / API services and Global Distribution Systems (GDS) to provide accurate and fast services.","Start Your Journey","With Wow Information Technology, you can offer travel services in a sophisticated manner to your customers and reach a global audience.","Our Services","Flight and Hotel Booking System","Create an online system offering flight and hotel booking options.","XML / API Systems","Connect the website to high-quality XML / API systems.","Web Development and Creation","We offer online travel services linked with flight booking systems.","Mobile App Development","Providing flight and hotel booking services through mobile apps.","Mobile Development","Mobile app marketing is a crucial necessity for the success of your company and for reaching hundreds of millions of smartphone users daily. It is the near future that combines all forms of marketing for services in various fields.","With extensive experience in developing travel apps for mobile devices, we create your own app and link it to your website. We measure the service needs of your customers and make them accessible via mobile, turning your idea into a reality that can interact with millions of travel and tourism enthusiasts and generate instant profits.",u.J,u.B,u.c,u.U,u.N,u._,"Achieve immediate profits.",u.r,"Easy control of the website.",u.y,"Direct online sales.","Website Development","The success of website elements is one of the most important reasons for your company's success. Therefore, we offer you a complete site with respect to the interface design, fast browsing, backend programming, client database, and connecting your site with internal users in your company. A complete professional site provided by a team of experienced and talented specialists, with support for solving technical issues during the integration of your site with user data.",u.J,u.B,u.c,u.U,u.N,u._,"Achieve immediate profits.",u.r,"Easy control of the website.",u.y,"Direct online sales.","Cruise System","Cruise System","Provide your customers with an online search and booking engine for cruise trips through your website, and allow them to book sea trips online. We offer direct communication with cruise service and data providers, including travel agents and companies, live and in real-time.","Online cruise trip booking","Real-time prices and timings for cruise trips","Best prices and profits","Online payment system","Special system for registration and database storage","Request Service",u.J,u.B,u.c,u.U,u.N,u._,"Achieve immediate profits.",u.r,"Easy control of the website.",u.y,"Direct online sales.","White Label System","White Label System","We enable direct communication with your customers via a white label platform, designed according to your specific preferences on your website. It provides you with an advanced search engine service linked to the database of all your tourism services, allowing you to communicate with customers, identify their needs through the search engine, and offer white label services. Easily and quickly sell hotel bookings, flights, travel trips, and vacations.",u.J,u.B,u.c,u.U,u.N,u._,"Achieve immediate profits.",u.r,"Easy control of the website.",u.y,"Direct online sales.","XML / API Systems",u.J,u.B,u.c,u.U,u.N,u._,"Immediate investment returns.","A wide base of data.","Easy control of the website.",u.y,"Direct online sales.","GDS System","GDS System","Choose the most suitable automated tourism service booking system and create a wide service booking network connected to major airlines around the world through your website, such as available seats for airlines, hotel rooms, car rentals, and other travel services from travel agents and major global companies offering distribution systems like Amadeus, Galileo, Sabre, and Worldspan.",u.J,u.B,u.c,u.U,u.N,u._,"Achieve immediate profits.",u.r,"Easy control of the website.",u.y,"Direct online sales.","Electronic Travel Solutions","Electronic Travel Solutions","In the midst of technological development using billions of internet and mobile app users, travel companies and agencies seek to develop electronic travel solutions in innovative and effective ways that help them succeed and reach customers interested in tourism and travel around the world. We offer you various electronic travel solutions by a team of specialists in the field of electronic travel and tourism, to design travel and tourism websites and connect them to a number of modern online tourism search engines for hotels, flights, XML, GDS, LCC, API, Car Rental API. You can aggregate tourism services, flight systems, and hotel data through your website and connect your services to companies and customers.",u.J,u.B,u.c,u.U,u.N,u._,"Achieve immediate profits.",u.r,"Easy control of the website.",u.y,"Direct online sales.","Thank you for your interest in Gate Waves Technologies services. Please provide the following information about your business needs to help us serve you better.","Enquiry","Company Name","Contact Person","Country","Select a Country","Code","Phone Number","Invalid Phone Number","Invalid Email","WhatsApp Number","Requirements in Detail","Submit","is required","Your enquiry has been submitted successfully","Add Enquiry","View on Google Maps"],t.yf)
